import axios from 'axios';

export const checkEmailExists = (email) => axios.get('52.78.190.152');
export const checkUsernameExists = (username) => axios.get('52.78.190.152');

export const localRegister = ({email, username, password}) => axios.post('52.78.190.152', { email, username, password });
export const localLogin = ({email, password}) => axios.post('52.78.190.152', { email, password });

export const checkStatus = () => axios.get('52.78.190.152');
export const logout = () => axios.post('52.78.190.152');
